description:
Role Models (2008)  

Verenigde Staten / Duitsland
Komedie
99 minuten

geregisseerd door David Wain
met Seann William Scott, Paul Rudd en Christopher Mintz-Plasse

Twee vertegenwoordigers van een producent van energie drankjes gaan op een avond iets te ver met hun ongein. Ze worden door de rechter gedwongen om vrijwilligerswerk te doen, namelijk het Big Brother programma, waar ze allebei te maken krijgen met een probleemjongere die ze moeten begeleiden.

Vanaf 12 maart in de bioscoop 


